import React, { Component } from "react";
import "./SecondSection.css";
import ProgressBar from "react-bootstrap/ProgressBar";

class SecondSection extends Component {
  state = {};

  render() {
    return (
      <div className="second-section">
        <div>{this.props.secondSection.title}</div>
        <div className="second-section-content">
          <div className="second-section-content-container">
            {this.props.secondSection.graphText}
            {this.props.secondSection.stats.map(stat => {
              return <ProgressBar now={now} label={stat.amount} />;
            })}
          </div>
          <div className="second-section-content-container flex-center">
            {this.props.secondSection.formText}
            <p className="aligned-center">
              We work with ecosystem leaders, corporations and startups
              worldwide. How can we help you?
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default SecondSection;
